// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Example {
    // 一个带有命名返回值的函数
    function returnNamed() public pure returns (uint256 number, bool boolValue, uint256[3] memory array) {
        number = 42;
        boolValue = true;
        array = [uint256(1), 2, 3];
    }

    // 读取返回值，解构式赋值
    function readReturn() public pure {
        // 读取全部返回值
        uint256 _number;
        bool _bool;
        uint256[3] memory _array;
        
        // 解构赋值
        (_number, _bool, _array) = returnNamed();
        
        // 读取部分返回值，解构式赋值
        bool _bool2;
        (, _bool2, ) = returnNamed();
    }
}

